function Campaign(props) {
  const type = props.typeSelect;

  const style = {
    background: "orange",
    height: "400px",
  };
  return (
    <div style={style}>
      <h1>사지 말고 입양하세요.</h1>
      <img src="banner.png"></img>
      <h1>{type} </h1>
    </div>
  );
}

export default Campaign;
